result:
.title{
  margin-bottom: 16px;
  color: #17233d;
  font-weight: 500;
  font-size: 14px;
}
.description{
  &-term {
    display: table-cell;
    padding-bottom: 10px;
    line-height: 20px;
    width: 50%;
    font-size: 12px;
  }
}
.logistics{
  align-items: center;
  padding: 10px 0px;
  .logistics_img{
    width: 45px;
    height: 45px;
    margin-right: 12px;
    img{
      width: 100%;
      height: 100%;
    }
  }
  .logistics_cent{
    span{
      display: block;
      font-size: 12px;
    }
  }
}
.trees-coadd{
  width: 100%;
  height: 400px;
  border-radius: 4px;
  overflow: hidden;
  .scollhide{
    width: 100%;
    height: 100%;
    overflow: auto;
    margin-left: 18px;
    padding: 10px 0 10px 0;
    box-sizing: border-box;
    .content{
      font-size: 12px;
    }
    .time{
      font-size: 12px;
      color: #2d8cf0;
    }
  }
}
.scollhide::-webkit-scrollbar {
  display: none; /* Chrome Safari */
}
